  assemblies:
  - dotNetRDF
  namespace: VDS.RDF
  summary: "\nThread Safe decorator for triple collections.\n"
  remarks: "\nDepending on the platform this either uses <xref href=\"System.Threading.ReaderWriterLockSlim\" data-throw-if-not-resolved=\"false\"></xref> to provide MRSW concurrency or it uses <xref href=\"System.Threading.Monitor\" data-throw-if-not-resolved=\"false\"></xref> to provide exclusive access concurrency, either way usage is thread safe.\n"
  example: []
  syntax:
    content: 'public class ThreadSafeTripleCollection : WrapperTripleCollection, IEnumerable<Triple>, IEnumerable, IDisposable'
    content.vb: >-
      Public Class ThreadSafeTripleCollection
          Inherits WrapperTripleCollection
          Implements IEnumerable(Of Triple), IEnumerable, IDisposable
